import React, { useEffect, useState } from "react";
import { toast } from "react-toastify";
import { Link, useNavigate } from "react-router-dom";
// CSS
import './Home.css';

// API
import { api } from "../../../utils/api";

// Layouts
import Header from "../../Layouts/Header";
import Title from "../../Layouts/Title";

// Icons
import { FiEdit2, FiMessageSquare, FiPlus, FiSearch } from "react-icons/fi";
import { PaginationControl } from "react-bootstrap-pagination-control";

const Home = () => {
    const [verify, setVerify] = useState<boolean>(false);
    const [page, setPage] = useState<number>(1);
    const [veiculos, setVeiculos] = useState<any>();
    const [dados, setdados] = useState<any>();
    const [loading, setLoading] = useState<boolean>(true);
    const navigate = useNavigate();

    useEffect(() => {
        const url = `vehicles?page=${page}`;
        api.get(url, {
            headers: {
                session: JSON.parse(localStorage.getItem('@session')!)
            }
        })
        .then((res: any) => {
            setLoading(false);
            setdados(res.data);
            console.log(res.data)
            if(res.data.message) {
                navigate('/login');
                toast.error(res.data.message);
                return;
            }

            setVeiculos(res.data.data);
        })
        .catch((erro: any) => {
            setLoading(false);
            navigate('/login');
            toast('Ocorreu algum erro, tente novamente');
        })
    }, [verify, page])

    const handleUri = (index: number) => {
        if(index < 0) {
            setPage(1);
            return;
        }
        if(index > dados.last_page){
            setPage(dados.last_page);
            return;
        }

        setPage(index);
        console.log(page);

    }

    if(loading) {
        return (
            <div>
                <Header />

                <div className="content">
                    <Link to={'/new'} className="new">
                        <FiPlus color="#FFF" size={25} />
                        Novo chamado
                    </Link>

                    <div className="container dashboard">
                        <span>Buscando chamados...</span>
                    </div>
                </div>
            </div>
        );
    }


    return(
        <div>
            <Header/>
            <div className="content">
                <Title name="Veiculos"> 
                    <FiMessageSquare size={25} />
                </Title>
                <>
                    {!veiculos
                        ? (
                            <div className="container dashboard">
                                <span>Nenhum chamado encontrado...</span>

                                <Link to={'/new'} className="new">
                                    <FiPlus color="#FFF" size={25} />
                                    Novo chamado
                                </Link>
                            </div>
                        )
                        : (
                            <>
                                <Link to={'/new'} className="new">
                                    <FiPlus color="#FFF" size={25} />
                                    Novo chamado
                                </Link>
                                <table>
                                    <thead>
                                        <tr>
                                            <th scope="col">Modelo</th>
                                            <th scope="col">Marca</th>
                                            <th scope="col">Placa</th>
                                            <th scope="col">Cor</th>
                                            <th scope="col">Ano</th>
                                            <th scope="col">#</th>
                                        </tr>
                                    </thead>
                                    <tbody>
                                        {veiculos.map((item: any, index: number) => (
                                            <tr key={index}>
                                                <td data-label="Modelo">{item.modelo}</td>
                                                <td data-label="Marca">{item.marca}</td>
                                                <td data-label="Placa">{item.placa}</td>
                                                <td data-label="Cor">{item.cor}</td>
                                                <td data-label="Ano">{item.ano}</td>
                                                <td data-label="#">
                                                    <button className="action" style={{backgroundColor: '#3583f6'}}>
                                                        <FiSearch color="#FFF" size={17} />
                                                    </button>

                                                    <Link className="action" style={{backgroundColor: '#f6a935'}} to={`/new/${item.id}`}>
                                                        <FiEdit2 color="#FFF" size={17} />
                                                    </Link>
                                                </td>
                                            </tr>
                                        ))}

                                    </tbody>
                                </table>
                            </>
                        )
                    }
                    <PaginationControl
                        page={page}
                        between={4}
                        total={5}
                        limit={10}
                        changePage={(page) => {
                        setPage(page); 
                        console.log(page)
                        }}
                        ellipsis={1}
                    />
                </>
            </div>
            {/* {showPostModal && <Modal conteudo={detail} close={() => setShowPostModal(!showPostModal)} />} */}
        </div>
    );
}

export default Home;
